import styles from './home.module.css';
import pitbull from '../../img/img-pitbull.png'
import logoName from '../../img/BULLDEV-logo .png';


function Home(){
	return(
		<>
			<div className={styles.triangule}>
				<svg>
  				<polygon points="0,50 0,530 1030,530" />
				</svg>
			</div>
			<div className={styles.pitbull}>
				<img src={pitbull} />
			</div>
			<div className={styles.textArea_welcome}>
	          <div className={styles.logo}>
	            <img src={logoName}/>
	          </div>				
			</div>



		</>

		)
}

export default Home;
